import './Profile.css';

const Profile = () => {
    return (
        <div>
        <img src='https://images.unsplash.com/photo-1611915387288-fd8d2f5f928b?ixlib=rb-1.2.1&q=80&fm=jpg&crop=entropy&cs=tinysrgb&w=1080&fit=max' width={100} height={100}></img>
        <p>Name: Vlad</p>
        <p>Age: 16</p>
        </div>
    );
}

export default Profile;
